import Asset from "./Asset";

const Assets = ({
  cash_investments,
  long_term_assets,
  is_editing,
  formatToCurrency,
  toggleEditing,
  currency,
  currency_codes,
  updateInputValue
}) => {
  console.log(cash_investments);
  return (
    <table className="table">
      <tbody>
        <tr>
          <th>Cash and Investments</th>
          <th></th>
          <th></th>
        </tr>
        {Object.entries(cash_investments).map(([key, value]) => (
          <Asset
            asset={value}
            key={value.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
            updateInputValue={updateInputValue}
          />
        ))}
        <tr>
          <th>Long Term Assets</th>
          <th></th>
          <th></th>
        </tr>
        {Object.entries(long_term_assets).map(([key, value]) => (
          <Asset
            key={value.id}
            asset={value}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
            updateInputValue={updateInputValue}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Assets;
